import React from "react";

function MyInfo() {
  return (
    <div>
      <h1>Ronak Gune</h1>
      <p>
        I am a recent graduate from SCU and am looking for new opportunities.
      </p>
      <ol>
        <li>Spain</li>
        <li>France</li>
        <li>Indonesia</li>
      </ol>
    </div>
  );
}

export default MyInfo;
